    false,nt"url": null,nt"notes": "nThis film documents student hiking trips
    conducted by the University of Colorado at Boulder in the Rocky  Mountains, Colorado,
    USA during the summers of 1938-1942. The hikes took place in various locations  west
    of Boulder, including Rocky Mountain National Park, Indian Peaks Wilderness, and
    Roosevelt National Forest. The film contains rare historical footage of the Rocky
    Mountains, including Arapaho Glacier and  Fair Glacier. The film provides a unique
    record of what those areas looked like at that time, and may  provide visual information
    on the extent of the glaciers. The film was created by the University of Colorado
     Department of Mountain Recreation. The original film consists of four reels, in
    16mm Kodachrome format.  The film was restored and digitized with support from the
    NOAA National Geophysical Data Center,  Boulder, and the NOAA Climate Database Modernization
    Program. Digitized copies of the film are available  on DVD. For information on
    ordering a copy, please contact NSIDC User Services.n",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
